import React from "react";
import { connect } from "react-redux";
import { addToWishlist } from "../../../redux/shop-reducer";
import s from "./Wishlist.module.css";

class Wishlist extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <div className={s.item}>
          <div>
            <img />
          </div>
          <div></div>
          <div></div>
        </div>
      </div>
    );
  }
}

export default connect([], {addToWishlist})(Wishlist);
